L’Onu ha approvato la Risoluzione per le malattie rare. Noi abbiamo già una legge, che è giovane perché approvata qualche settimana fa. Il mio impegno nei prossimi mesi sarà quello di far attuare davvero la risoluzione Onu in Italia!
